15.   OPERATIONAL FLOW ORDERS

15.1	Issuance.  Transporter, in its reasonable discretion, shall have the right to issue OFOs at any time when in its reasonable judgment it is necessary to maintain or restore the operational integrity of its System.  Additional circumstances under which Transporter may determine that OFOs may be issued include, but are not limited to:

(a)	Responding to an event of force majeure; 

(b)	When an emergency arises that impacts line pack in order to insure maintenance of the necessary level of line pack; 

(c)	Accommodating emergency maintenance and repairs; and/or

(d)	Preventing receipts or deliveries that conflict with contractual entitlements of others.

15.2	Automatic Issuance.  Unless otherwise specified by Transporter, an OFO identical in terms to that of the Delivering Pipeline shall be deemed to be issued automatically by Transporter whenever the Delivering Pipeline or the Receiving Pipeline issues an OFO affecting deliveries to or by Transporter.  

15.3	Identification of Shippers.  Whenever possible, Transporter shall identify those Shipper(s) whose action(s) require Transporter to issue an OFO and shall limit the applicability of the OFO to such Shipper(s).  If Transporter is unable to identify those Shipper(s) whose action(s) require issuance of an OFO, or if issuance of an OFO to discrete Shipper(s) is insufficient to alleviate the conditions requiring the issuance of such OFO, Transporter may issue an additional OFO applicable to all Shippers on a nondiscriminatory basis.  

15.4	Notice.  Transporter shall notify the affected Shipper(s) by a facsimile transmission, Internet email or other mutually agreeable means of electronic communication that will set forth the causes or conditions necessitating the OFO, unless notice has already been deemed given as provided in Section 15.2 above.  Transporter shall issue an OFO as expeditiously as is reasonable and practicable in the circumstances.  Each Shipper shall designate an operational contact for Transporter to notify on a 24 hour a day, 365 days a year basis.  If Transporter is unable to notify any Shipper because that Shipper's contact is unavailable, such Shipper shall be solely responsible for any consequences arising from such failure of communication.  When practicable, Transporter shall provide sufficient notice to customers to accommodate scheduling requirements on upstream pipelines. Each OFO will contain the following provisions:

(a)	time and date of issuance;  

(b)	time that the OFO is considered to be effective (if no time is specified, the OFO shall be effective immediately);  

(c)	duration of the OFO (if none is specified, the OFO will be effective until further notice);  

(d)	the party or parties receiving the OFO;  

(e)	causes or conditions requiring issuance of the OFO;  

(f)	specific action necessary to remedy the causes or conditions; and 

(g)	any other terms Transporter may reasonably require to ensure the effectiveness of the OFO.

On the Day prior to the commencement of the Gas Day, no later than 5:00 p.m. Central Clock Time, during the scheduling and confirmation procedure, Transporter will post the OFO(s) on Transporter's Designated Site.  Unless otherwise specified in the OFO, compliance must commence at the beginning of the applicable Gas Day.

15.5	Failure to Comply with OFO.  If Shipper (or Shipper's designee or successor) fails to comply with the terms of an OFO for reasons other than force majeure such Shipper, its designee or successor shall be liable for a penalty equal to the greater of twenty-five dollars ($25.00) or four (4) times the highest absolute price at Kern River/Opal as reflected in the Daily Price Survey in Platt's Energy Trader "Gas Daily" for each of the Days during which a Shipper fails to comply with an OFO for each Dth of Gas that does not comply.  Transporter may in its reasonable judgment waive on a nondiscriminatory basis penalties due to noncompliance with an issued OFO.  No penalties shall be assessed on Shipper for noncompliance with an issued OFO when such OFO is due to force majeure invoked by Transporter.  

15.6	OFO Penalty Revenue Crediting.  Transporter shall credit penalty revenues, less reasonable administrative and operating costs, received by Transporter during any Month.  Such credits will be allocated to all firm and interruptible transportation customers (collectively, the "Specified Customers"), except each penalty revenue credit shall be allocated only to those customers who were not assessed any such penalty in the Month for which such penalty revenues are to be credited.  The credits will be allocated to the Specified Customers pro rata in proportion to the revenue (total revenue, net of credits from capacity releases as described in Section 19 of the General Terms and Conditions, less all surcharges) received by Transporter from each and all of the Specified Customers for each applicable Month.  Such revenue credits shall be reflected as a credit billing adjustment to the next Month's billings rendered after the applicable Month.  In the event that such credit billing adjustments would result in a credit total invoice to any Specified Customer, Transporter will refund the credit billing adjustment to the Specified Customer in cash within fifteen (15) Days after determination of the amount of the credit due to the Specified Customer.  

15.7	Shipper Not Liable.  Shipper will not be liable for any penalties which might otherwise be imposed by Transporter with respect to any action taken by such Shipper in conformance with an OFO issued by Transporter.  

15.8	Transporter Not Liable.  Transporter will not be liable for any damages, costs or expenses incurred as a result of an OFO.  

15.9	Reporting.  Within ten (10) Days after an OFO terminates, Transporter will post a report on Transporter's Designated Site containing information on the factors that caused the OFO to be imposed and to be terminated.

19.   CAPACITY RELEASE

19.1	Definitions.  For the purposes of this Section 19, the following definitions will apply to Capacity Releases.

(a)	Releasing Shipper:  A firm Shipper or Replacement Shipper under an executed Service Agreement that pays a Reservation Charge and that intends to have Transporter post all or any portion of firm capacity for which it pays a Reservation Charge to be released to a Replacement Shipper.  

(b)	Replacement Shipper:  A Shipper that has contracted for service with Transporter to utilize a Releasing Shipper's released firm service for a specified period of time.  Replacement Shippers must meet all of the terms and conditions of Transporter's Tariff as required of any other Shipper.  

(c)	Potential Replacement Shipper:  A Shipper that desires to acquire released firm capacity.  

(d)	Bidder:  A party submitting a bid(s) to Transporter for released capacity.  

(e)	Prearranged Bidder:  A party that desires to contract directly for or who has contracted directly for capacity of a Releasing Shipper and that has agreed to the terms of a capacity release transaction directly with a Releasing Shipper.  Prearranged Bidders must meet all of the terms and conditions of Transporter's Tariff as required of any other Shipper.

(f)	Open Bidding:  Full disclosure of the bid(s) submitted to the Designated Site, excluding the bidder(s) name.  

(g)	The Economic Value of a bid:  The total net present value of the reservation charge bid for the release of firm capacity. The net present value shall be computed from the monthly demand and capacity, or reservation revenues to be received over the term of the release contract, using the discounted cash flow rate of return methodology, with the rate of discounting, as updated from time to time, to be posted on Transporter's Designated Site.  

For the capacity release business process timing model, only the following methodologies are required to be supported by capacity release service providers and provided to Releasing Shippers as choices from which they may select and, once chosen, should be used in determining the awards from the bid(s) submitted.  They are:  1) highest rate, 2) net revenue and 3) present value.  Other choices of bid evaluation methodology (including other Releasing Shipper defined evaluation methodologies) can be accorded similar timeline evaluation treatment at the discretion of the capacity release service provider.  However, Transporter is not required to offer other choices or similar timeline treatment for other choices, nor, is Transporter held to the timeline should the Releasing Shipper elect another method of evaluation.  

(h)	Open Season:  The minimum number of Business Days allowed for posting releases and accepting bids. 

19.2	General Provisions.

(a)	Any Shipper is eligible to release for use by another party all or part of firm capacity for which the Releasing Shipper pays a monthly reservation charge.  Capacity to be released shall be defined as capacity between a Receipt Point and a Delivery Point, for use by another party for a minimum term of one (1) Day and a maximum term not to exceed the remaining term of the Releasing Shipper's firm Service Agreement.   

(b)	Any Replacement Shipper that has previously contracted for released capacity may also release the capacity to another party, thereby becoming a Releasing Shipper, subject to the requirements of this Section 19.  

(c)	Any Potential Replacement Shippers may submit to Transporter by facsimile transmission, Internet email or other mutually agreeable means of electronic communication offer(s) to purchase released capacity.  If an offer to purchase results in a capacity release being offered, such release is subject to the bidding requirements of this Section.  Offers to purchase capacity must include desired receipt and delivery point(s), contract volume, and contract term.

(d)	All release requests under Section 19.3 below and bids for released capacity under Section 19.4 below must be submitted to Transporter by facsimile transmission, Internet email or other mutually agreeable means of electronic communication.  Transporter shall post on its Designated Site release requests, offers to purchase released capacity, bids for released capacity and awards of released capacity under Section 19.5 below in accordance with the capacity release timeline set forth in Section 19.6 below.  

19.3	Release Requests.  All requests to release capacity shall set forth the following:  

(a)	Releasing Shipper's name, contract number and contract quantity to be released; 

(b)	Receipt Point and Delivery Point;

(c)	Commencement date and termination date for the release; 

(d)	Minimum volume, minimum term, and minimum rate for the release which Releasing Shipper is willing to accept; 

(e)	Whether the release will occur on a firm recallable or nonrecallable basis and, if on a recallable basis, the specific terms and conditions under which recall may occur;

(f)	Whether the release is subject to any reput rights and the specific terms and conditions under which such reput rights may be exercised;

(g)	Any specific conditions of the release, which conditions must be objectively stated, applicable to all bidders, operationally feasible, non-discriminatory to other shippers and consistent with this Tariff.  If Releasing Shipper submits no release conditions, or Transporter finds the requested conditions operationally infeasible or inconsistent with this Tariff, the released capacity shall be subject to the conditions currently effective in this Tariff.  Releasing Shipper must notify Transporter if the minimum conditions precedent to the release are not to be posted on the Designated Site until after the capacity is awarded; 

(h)	An irrevocable statement, subject only to the provisions of Section 19.7, that the Releasing Shipper will release its transportation rights on the terms and conditions set forth in its Release Request if all such terms are accepted by a Bidder; and

(i)	Whether the Releasing Shipper has entered into a binding agreement to release its transportation rights to a Prearranged Bidder.  In such event, the Releasing Shipper shall additionally submit the following:

(i)	The Prearranged Bidder's legal name, and the name, telephone number, facsimile transmission number and Internet email address of the person to contact concerning the prearranged release;

(ii)	All terms and conditions to which the Prearranged Bidder has agreed;

(iii)	A statement which represents and warrants that the Prearranged Bidder has entered into a binding agreement with the Releasing Shipper to accept the transportation rights on the terms and conditions prescribed in the Release Request.  Upon Transporter's request, the Releasing Shipper will provide Transporter with a true and complete copy of a fully executed written arrangement between the Releasing Shipper and the Prearranged Bidder concerning the proposed release;

(iv)	Whether the Prearranged Bidder is an asset manager as defined in 18 C.F.R. Section 284.8(h)(3) or a marketer participating in a state-regulated retail access program as defined in 18 C.F.R. Section 284.(h)(4); and

(v)	If the Prearranged Bidder is an asset manager, the asset manager's obligation to deliver gas to, or purchase gas from, the Releasing Shipper.

19.4	Bidding.  All bids for released capacity shall include the following:

(a)	Bidder's name and the name, telephone number, fax number and email address of the person to contact concerning the bid; 

(b)	Release Request number bidding on; 

(c)	Proposed commencement and termination date of the release term, which must be consistent with term specified in the Release Request; 

(d)	Proposed Receipt Point and Delivery Point;

(e)	Proposed quantity and rate comprising the bid;

(f)	Minimum percentage of the volume which the Bidder is willing to accept;

(g)	If applicable, any affiliate of Transporter involved in the transaction; and

(h)	An irrevocable statement, subject only to the provisions of Section 19.7, that the Bidder agrees to accept the release in accordance with the terms and conditions set forth in the Release Request.

(i)	If a prearranged release, whether the Prearranged Bidder is an asset manager as defined in 18 C.F.R. Section 284.8(h)(3) or a marketer participating in a state-regulated retail access program as defined in 18 C.F.R. Section 284.8(h)(4); and

(j)	If the Prearranged Bidder is an asset manager, the asset manager's obligation to deliver gas to, or purchase gas from, the Releasing Shipper.

19.5	Awarding of Released Capacity.  Transporter shall determine the winning bid. 

(a)	Unless Releasing Shipper specifies otherwise, bids will be evaluated based on the Economic Value of the reservation charges bid by each Bidder.

(b)	If a Release Request includes a Prearranged Bidder, then the release will be awarded to the Prearranged Bidder if its bid has an Economic Value that is equal to or higher than the highest Economic Value of each of the bids submitted by all other Bidders, or if it matches the bid with the highest Economic Value within the time period provided by Section 19.6.

(c)	If only one Bidder has submitted a bid which reflects the highest Economic Value, then the capacity will be awarded to that Bidder, subject to any Prearranged Bidder's exercise of its right to match as set forth in 19.5(b).

(d)	If two or more Bidders have submitted bids which each reflect the highest Economic Value, then, subject to any Prearranged Bidder's exercise of its right to match as set forth in 19.5(b), the capacity will be awarded on the basis of a lottery which is limited to such Bidders.  Transporter will conduct the lottery using a computerized random number generator unless the releasing Shipper specifies another non-discriminatory method for determining the winning bid.  Transporter's lottery or calculation of the applied method will result in the award of released capacity to only one (1) successful Bidder per Release Request.     

(e)	If the capacity to be awarded to the highest Bidder would not result in awarding all of the capacity to be released, then Transporter shall award the remaining capacity based on the Economic Value of each bid for each receipt and delivery point combination, from highest Economic Value to lowest Economic Value, with the process of awarding capacity to Bidders continuing until all of the capacity has been awarded or until all valid bids have been accepted.  Transporter shall break ties and determine the winning bid(s) in those situations by holding a lottery using a computerized random number generator unless the releasing Shipper specifies another non-discriminatory method for determining the winning bid.  

(f)	A Replacement Shipper must comply with Section 11 of the General Terms and Conditions of this Tariff.  A Bidder must submit a request for pre-qualification for credit as a Shipper to Transporter in order to expedite implementation of capacity release service.  For releases of less than one (1) year, a Replacement Shipper may not submit a bid where the Economic Value exceeds that Shipper's established credit limit.  For releases of one (1) year or more, if a Replacement Shipper submits a bid where the Economic Value exceeds that Shipper's established credit limit, that Shipper must provide sufficient documentation to assure Transporter of that Shipper's ability to pay for the service in excess of the established credit limit within one (1) Day after notification that Shipper's bid will be acceptable contingent upon Shipper's demonstration of its ability to pay to Transporter's satisfaction.  

For releases of one (1) year or more, if Replacement Shipper fails to so demonstrate, such released service shall be awarded to the bidder who is creditworthy and who submitted the bid with the next highest Economic Value.  If no additional bids were submitted by creditworthy bidders, then all bidders shall have one (1) week to demonstrate creditworthiness to Transporter's satisfaction.  The service offered for release shall then be awarded to the bidder who is creditworthy and who submitted the bid with the highest Economic Value.  If no creditworthy bids are submitted, the capacity release process shall terminate, but the Releasing Shipper may elect to request a release of the subject capacity at a later time.

(g)	Releasing Shipper is responsible for payment of reservation charges for the release of transportation capacity.  Transporter shall not be liable to Releasing Shipper for the revenue credits provided for in Section 19.9 herein in the event any Replacement Shipper fails to pay any applicable reservation charges to Transporter.  However, Releasing Shipper shall retain a subrogated right to demand payment from any Replacement Shipper in the event any Replacement Shipper is delinquent on any such payment owed Transporter.  

(h)	A Releasing Shipper may withdraw its release in accordance with NAESB Standard 5.3.14 and prior to receipt of a valid bid.  

(i)	A Bidder may withdraw its bid in accordance with NAESB Standard 5.3.13, provided, however, that the Bidder may not then resubmit a bid with a lower Economic Value for the same capacity.  Bidder may not submit multiple bids on the same release package.  

(j)	Transporter will provide service to a Replacement Shipper pursuant to an executed Service Agreement.  Transporter's accepted bid for release of firm capacity or the posting specified in Section 19.4 will constitute an exhibit to the Service Agreement between Transporter and the Replacement Shipper.  The Release Request along with the accepted bid(s) for release of firm capacity shall also constitute an amendment to the Service Agreement between Releasing Shipper and Transporter, and shall be reflected in an Exhibit D to such Service Agreement. 

(k)	Transporter may assess a marketing fee to a Releasing Shipper, if agreed upon by both Transporter and Releasing Shipper, pursuant to a separately negotiated marketing contract, for marketing services to be performed by Transporter.  

(l)	All terms of Capacity Release transactions between Transporter, the Releasing Shipper and the Replacement Shipper must be agreed to through the public notification and posting procedures contained herein.

19.6	Capacity Release Timeline.  The Capacity Release timeline is applicable to all parties involved in the Capacity Release process; however, it is only applicable if all information provided by the parties to the transaction is valid and the acquiring shipper has been determined to be credit worthy before the capacity release bid is tendered, and there are no special terms or conditions of the release.

       For biddable releases (1 year or less):
- 	Offers should be tendered by 9:00 A.M. on a Business Day; 
- 	open season ends no later than 10:00 A.M. on a Business Day (evaluation period begins at 10:00 A.M. during which contingency is eliminated, determination of best Bid is made, and ties are broken);  
-	if no match is required, the evaluation period ends and Award posting by 11:00 A.M.;  
-	where match is required, match is communicated by 11:00 A.M.; 
-	match response occurs by 11:30 A.M.;  
-	Award posting by 12:00 Noon;
-	contract issued within one hour of Award posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract. (Central Clock Time)

       For biddable releases (more than 1 year):
-	Offers should be tendered by 9:00 A.M. on a Business Day; 
-	open season should include no less than three 9:00 A.M. to 10:00 A.M. time periods on consecutive Business Days; 
-	evaluation period begins at 10:00 A.M. during which contingency is eliminated, determination of best Bid is made, and ties are broken; 
-	if no match is required, the evaluation period ends and Award posting at 11:00 A.M.;  
-	where match response is required, match is communicated by 11:00 A.M.; 
-	match response occurs by 11:30 A.M.; 
-	Award posting by 12:00 Noon; 
-	contract issued within one hour of Award posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract. (Central Clock Time)

       For non-biddable releases:
Timely Cycle
-	posting of prearranged deals not subject to bid are due by 12:00 Noon; 
-	contract issued within one hour of Award posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract. (Central Clock Time)

Evening Cycle
-	posting of prearranged deals not subject to bid are due by 5:00 P.M.; 
-	contract issued within one hour of Award posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract. (Central Clock Time)

       Intraday 1 Cycle
-	posting of prearranged deals not subject to bid are due by 9:00 A.M.; 
-	contract issued within one hour of Award posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract. (Central Clock Time)

       Intraday 2 Cycle
-	posting of prearranged deals not subject to bid are due by 1:30 P.M.; 
-	contract issued within one hour of Award posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract. (Central Clock Time)

       Intraday 3 Cycle
-	posting of prearranged deals not subject to bid are due by 6:00 P.M.; 
-	contract issued within one hour of Award posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract. (Central Clock Time)

19.7	Prearranged Releases.

(a)	A Releasing Shipper may release capacity to a Prearranged Bidder for a period of up to thirty one (31) Days in the same calendar month without having to comply with the notification and bidding requirements of this Section 19.  A Releasing Shipper may not re-release capacity covered by this Section 19.7 to the same Prearranged Bidder until twenty eight (28) Days after the first release period has ended.  In addition, the commencement date of the term of any release under this Section 19.7 is at least twenty eight (28) Days after the termination date of any previous release under this Section 19.7 by Releasing Shipper to the same Replacement Shipper.

(b)	A prearranged release to a Prearranged Bidder that is a qualified asset manager as defined in 18 C.F.R. Section 284.8(h)(3) or a marketer participating in a state-regulated retail access program as defined in 18 C.F.R. Section 284.8(h)(4), is exempt from the bidding requirements of this Section 19.  If the prearranged release is to a Prearranged Bidder that is a qualified asset manager or a marketer participating in a state-regulated retail access program exempt from the bidding requirements of 18 C.F.R. Section 284.8(h)(1), notice of the release will be provided on the pipeline's Internet web site as soon as possible, but not later than the first nomination, after the release transaction commences.

19.8	Permanent Releases of Capacity.

(a)	Bidding Procedures and Exit Fee.

(i)	To the extent that any Releasing Shipper desires to release all or any part of its firm contract rights on a permanent basis, the bidding procedures specified in Section 19 will apply.  The procedures for establishment of credit must be complied with before Transporter effectuates any permanent releases of capacity under this Section 19.8.  

(ii)	Any permanent releases under this Section 19.8(a) shall require Releasing Shipper to pay an exit fee, but only to the extent necessary to fully compensate Transporter if the accepted bid price and/or contract term of the replacement Service Agreement(s) would require Transporter to forego future revenues.  

(iii)	The exit fee described in Section 19.8(a)(ii) above shall be the net present value of all reservation charges payable to Transporter by the Releasing Shipper over the remaining life of the applicable Service Agreement, reduced by the net present value of such charges payable to Transporter by all applicable Replacement Shippers.

(b)  Procedures.

(i)	Replacement Shipper(s) and Transporter shall execute a new Service Agreement(s) prior to the commencement of service which confirms the terms of the accepted transaction for the permanent release of capacity.  

(ii)	Effective with implementation of service under the new executed Service Agreements, Releasing Shipper's Service Agreement shall be deemed terminated and Releasing Shipper shall have no further obligations to Transporter with respect to the released capacity, except as to unsatisfied obligations which arose prior to the execution of the new Service Agreement(s).

19.9	Revenue Credits for Released Capacity.

(a)	Eligibility.  Transporter shall provide revenue credits to any Shipper, which temporarily releases, under the Capacity Release Provisions of this Tariff, all or any portion of its contract demand under a Service Agreement governed by the provisions of Rate Schedule FT included in Transporter's Tariff.  

(b)	Monthly Crediting Procedure.  Releasing Shipper shall be billed each Month for the reservation charge(s) associated with the released capacity pursuant to its Service Agreement, with a concurrent conditional credit for the payment of the reservation charge(s) due from the Replacement Shipper; provided, however, if the reservation charge(s) due from the Replacement Shipper exceed the reservation charge associated with the capacity released by the Releasing Shipper, then Transporter will include a concurrent conditional credit of an amount equal to the reservation charges associated with the capacity released by the Releasing Shipper plus one half of the reservation charge(s) due from the Replacement Shipper that are in excess of the reservation charge associated with the capacity released by the Releasing Shipper.  This bill shall include an itemization of credits and adjustments associated with each Capacity Release Service Agreement.  Releasing Shipper shall also be billed a marketing fee pursuant to Section 19.10, if applicable.   

(c)	Failure to pay.  If a Replacement Shipper does not make payment to Transporter of the reservation charge(s) due as set forth in Section 5, Transporter shall notify the Releasing Shipper within ten (10) Business Days of the amount due, including all late charges authorized in Section 5, and such amount shall be paid by Releasing Shipper.  In addition, Releasing Shipper may terminate the release of capacity to a Replacement Shipper if such Replacement Shipper fails to pay all of the amount of any bill for service under the executed capacity release Service Agreement upon at least one (1) week of notice to Transporter and such Replacement Shipper.  Once terminated, capacity rights and the responsibility to pay all charges specified in the original service agreement applicable to the capacity that was released shall revert back to the Releasing Shipper.  

Transporter shall apply partial payments received from Replacement Shippers, in interpreting the provisions of this section 19.9, first to reservation charges, then to usage charges, then to penalty charges and finally to late charges.  

19.10	Marketing Fee.  Transporter will be entitled to receive a marketing fee from Releasing Shipper in the event Transporter and Releasing Shipper agree that Transporter will actively market Releasing Shipper's transportation rights under this Section 19.


19.11	Offers to Purchase Capacity.  Transporter will post, as a Notice on its Informational Postings website, instructions describing how interested parties may submit a request to purchase releasable capacity from current Shippers.  The instructions will include the information that is required for such a request.  Upon receipt of a correctly completed request to purchase capacity, Transporter will post the request as a Notice on its Informational Postings website.  Such requests will remain posted on the Informational Postings website for a minimum of 90 days.  The e-mail address to which the request should be sent is Rendezvous.Pipeline@qepres.com.
